#include<stdio.h>
#include<stdlib.h>
#include<stddef.h>
struct node
{
    struct node *plink;
    int data;
    struct node *nlink;
};
struct node *generate()
{
    struct node *New;
    New=(struct node*)malloc(sizeof(struct node));
    return New;
}
struct node *insertion(struct node *start,int pos,int item)
{
    struct node *temp, *New;
    temp=start;
    New=generate();
    New->nlink = start;
    New->plink = NULL;
    New->data=item;
    if(pos==1)
    {
     New ->nlink=temp;
     temp->plink=New;
     start=New;
     temp=New;
    }
 else
 {
    while(pos>2)
    {
        temp=temp->nlink;
        if(temp->nlink==NULL)
        break;
        pos=pos-1;
    }
    if(pos==2)
    {
        New->plink=temp;
        New->nlink=temp->nlink;
        temp->nlink=New;
    }
    temp->nlink=New;
    New->plink=temp;
    temp=start;
}
   return temp;
}
struct node *deletion(struct node*start,int pos)
{
    struct node *temp,*temp1;
    temp=start;
    if(pos==1)
   {
       temp=temp->nlink;
       temp->plink=NULL;
       start=temp;
   }
   else
   {
       temp=start;
       while(pos>2)
       {
           temp=temp->nlink;
           pos=pos-1;
       }
       temp1=temp->nlink;
       temp->nlink=temp1->nlink;
       if(temp1->nlink!= NULL)
       (temp1->nlink)->plink=temp;
   }
   temp->nlink=start;
   return start;
}
